pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED

import "./Interfaces/ITrustAnchorManager.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/// @dev
/// | The Trust Anchor Extra Data [Generic] reference contract
/// | This contract is an example of the type of parameters most useful in a Data Retrieval context. Primarily, it is the ip addresses that are associated to a variable number of endpoints.
/// | Endpoint names are also part of the context to have a human-readable structure, and this name is keccak hashed for future quick lookups internally.


contract TrustAnchorExtraData_Generic is Ownable {
    /// @dev Event for Data Retrieval Endpoint is Enabled for a specific Endpoint name.
    event EVT_setTrustAnchorDataRetrievalEndpointIsEnabled(address indexed _trustAnchorAddress, string _endpointName, bool _isEnabled);

    /// @dev Event for Data Retrieval Parameters being created by a Trust Anchor.
    event EVT_setDataRetrievalParametersCreated(address indexed _trustAnchorAddress, string _endpointName,  uint8[4] _ipv4Address);

    /// @dev Event for Data Retrieval Parameters being updated by a Trust Anchor.
    event EVT_setDataRetrievalParametersUpdated(address indexed _trustAnchorAddress, string _endpointName,  uint8[4] _ipv4Address);

    /// @dev Struct for a Trust Anchor data retrieval ip address endpoints with a string to associated names.
    struct endpoint {
        string endpointName;
        uint8[4] ipv4Address;

        bool isEnabled;
        bool doesExist;
    }

    /// @dev Struct for a Trust Anchor data retrieval parameters.
    struct trustAnchorDataRetrievalParameters {
        mapping(bytes32 => endpoint) keccakHash_to_dataRetrievalEndpoint;
        bytes32[] dataRetrievalEndpointHashArray;
    }

    /// @dev Mapping for a Trust Anchor to its generic extraData parameters.
    mapping(address => trustAnchorDataRetrievalParameters) extraData_dataRetrievalParameters;

    /// @dev The Trust Anchor Manager address that this contract is bound to.
    address trustAnchorManagerAddress = address(0);

    /// @dev Initializes this contract with the owner set to the calling public address.

    constructor() Ownable() {
    }

    /// @param _trustAnchorManagerAddress The smart contract address for the Trust Anchor Manager that should be linked.
    /// @dev Links Trust Anchor Manager to this contract's function flow.
    /// @return result
    ///    | false: [ will never return false due to require() ]
    ///    | true: trust anchor manager address set correctly

    function setTrustAnchorManagerAddress(address _trustAnchorManagerAddress) public onlyOwner returns (bool result) {
        require(_trustAnchorManagerAddress != address(0));

        trustAnchorManagerAddress = _trustAnchorManagerAddress;

        //trust anchor manager address set correctly
        return true;
    }

    /// @dev Gets the Trust Anchor Manager associated to this contract.
    /// @return result trust anchor manager address

    function getTrustAnchorManagerAddress() public view returns (address result) {
        //get trust anchor manager address
        return trustAnchorManagerAddress;
    }

    /// @param _trustAnchorAddress The smart contract address that is checked for extraData availability.
    /// @dev Checks whether a specific Trust Anchor has extraData associated to it.
    /// @return result
    ///    | false: trust anchor has no extraData parameters allocated
    ///    | true: trust anchor does has extraData parameters allocated

    function doesTrustAnchorHaveExtraData(address _trustAnchorAddress) public view returns (bool result) {
        if (extraData_dataRetrievalParameters[_trustAnchorAddress].dataRetrievalEndpointHashArray.length > 0) {
            //trust anchor does has extraData parameters allocated
            return true;
        } else {
            //trust anchor has no extraData parameters allocated
            return false;
        }
    }

    /// @param _endpointName The name of the endpoint.
    /// @param _ipv4Address The ipv4 address, an array of 4 uint8's (0-255) corresponding to w.x.y.z components of an ip address.
    /// @dev Checks whether a specific Trust Anchor has "generic" extraData associated to it with a specific endpoint name, updates if necessary, and returns the status. Sets the endpoint to "enabled" status if it's being set for the first time.
    /// @notice Must be called by the Trust Anchor that wants to set their associated generic data.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: endpoint set for the first time
    ///    | 2: endpoint updated

    function setTrustAnchorDataRetrievalParameters(string memory _endpointName, uint8[4] memory _ipv4Address) public returns (uint8 result) {
        bytes32 endpointKeccak = keccak256(abi.encodePacked(_endpointName));

        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {
            // get the endpoint if it already exists, otherwise create a new endpoint.
            endpoint storage newEndpoint = extraData_dataRetrievalParameters[msg.sender].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

            // set the parameters based on inputs.
            newEndpoint.endpointName = _endpointName;

            newEndpoint.ipv4Address[0] = _ipv4Address[0];
            newEndpoint.ipv4Address[1] = _ipv4Address[1];
            newEndpoint.ipv4Address[2] = _ipv4Address[2];
            newEndpoint.ipv4Address[3] = _ipv4Address[3];

            // checks whether this particular endpoint already exists for this Trust Anchor.
            if (newEndpoint.doesExist == true) {
                emit EVT_setDataRetrievalParametersUpdated(msg.sender, _endpointName, _ipv4Address);
                //endpoint updated
                return 2;
            } else {
                emit EVT_setDataRetrievalParametersCreated(msg.sender, _endpointName, _ipv4Address);
                // if endpoint doesn't already exist, set the parameters required for further lookups.
                newEndpoint.doesExist = true;
                newEndpoint.isEnabled = true;

                // pushes the new endpointKeccak to the endpoint array.
                extraData_dataRetrievalParameters[msg.sender].dataRetrievalEndpointHashArray.push(endpointKeccak);

                //endpoint set for the first time
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _endpointName The name of the endpoint.
    /// @param _isEnabled The boolean yes/no of whether this endpoint should be set to enabled or not.
    /// @dev Checks whether a specific Trust Anchor has "generic" extraData associated to it with a specific endpoint name, and updates the isEnabled if it already exists, and returns the status.
    /// @notice Must be called by the Trust Anchor that wants to set their associated generic data.
    /// @return result
    ///    | 0: trust anchor is not verified
    ///    | 1: endpoint does not exist
    ///    | 2: endpoint's enabled status updated

    function setTrustAnchorDataRetrievalEndpointIsEnabled(string memory _endpointName, bool _isEnabled) public returns (uint8 result) {
        bytes32 endpointKeccak = keccak256(abi.encodePacked(_endpointName));

        ITrustAnchorManager trustAnchorManager = ITrustAnchorManager(trustAnchorManagerAddress);

        // check whether trust Anchor manager is verified
        if (trustAnchorManager.isTrustAnchorVerified(msg.sender)) {

            // get the endpoint if it already exists.
            endpoint storage existingEndpoint = extraData_dataRetrievalParameters[msg.sender].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

            // if this endpoint already exists, set the isEnabled flag based on input parameters.
            if (existingEndpoint.doesExist == true) {
                emit EVT_setTrustAnchorDataRetrievalEndpointIsEnabled(msg.sender, _endpointName, _isEnabled);

                existingEndpoint.isEnabled = _isEnabled;

                //endpoint's enabled status updated
                return 2;
            } else {
                //endpoint does not exist
                return 1;
            }
        } else {
            //trust anchor is not verified
            return 0;
        }
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @dev Gets the number of endpoints associated to this Trust Anchor.
    /// @return result the number of endpoints associated to this Trust Anchor.

    function getTrustAnchorNumberOfEndpoints(address _trustAnchorAddress) public view returns (uint256 result) {
        return extraData_dataRetrievalParameters[_trustAnchorAddress].dataRetrievalEndpointHashArray.length;
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @param _index The index within this Trust Anchor's endpoint array.
    /// @dev Gets the endpoint name for a specific index within the Trust Anchor's endpoint array.
    /// @notice Checks to make sure that the _index parameter is not out of bounds.
    /// @return doesExist whether the endpoint data exists, ( false, "" ): endpoint data does not exist
    /// @return endpointName the endpoint name

    function getTrustAnchorEndpointNameByIndex(address _trustAnchorAddress, uint256 _index) public view returns (bool doesExist, string memory endpointName) {
        // checks whether this particular endpoint already exists for this Trust Anchor.
        if (extraData_dataRetrievalParameters[_trustAnchorAddress].dataRetrievalEndpointHashArray.length > _index) {
            bytes32 endpointKeccak = extraData_dataRetrievalParameters[_trustAnchorAddress].dataRetrievalEndpointHashArray[_index];

            endpoint storage existingEndpoint = extraData_dataRetrievalParameters[_trustAnchorAddress].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

            //endpoint data exists, returns the endpoint name
            return (true, existingEndpoint.endpointName);
        } else {
            //endpoint data does not exist
            return (false, "");
        }
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @param _endpointName The name of the endpoint.
    /// @dev Gets the data retrieval parameters (whether it exists, the actual endpoint data, and whether it's enabled) for this particular _endpointName.
    /// @return doesExist whether the endpoint data exists, ( false, [0, 0, 0, 0], false ): endpoint data does not exist
    /// @return ipv4Address the ipv4 components
    /// @return isEnabled whether this endpoint is enabled

    function getTrustAnchorDataRetrievalParameters(address _trustAnchorAddress, string memory _endpointName) public view returns (bool doesExist, uint8[4] memory ipv4Address, bool isEnabled) {
        bytes32 endpointKeccak = keccak256(abi.encodePacked(_endpointName));

        // gets the endpoint.
        endpoint storage existingEndpoint = extraData_dataRetrievalParameters[_trustAnchorAddress].keccakHash_to_dataRetrievalEndpoint[endpointKeccak];

        // checks whether this particular endpoint already exists for this Trust Anchor.
        if (existingEndpoint.doesExist == true) {
            //if the endpoint exists, the extraData ip address parameters for this Trust Anchor have a proper endpoint.

            //endpoint data exists, and the return components
            return (true, existingEndpoint.ipv4Address, existingEndpoint.isEnabled);
        } else {
            //endpoint data does not exist
            return (false, [0,0,0,0], false);
        }
    }

    /// @param _trustAnchorAddress The trust anchor address related to this extraData.
    /// @param _endpointKeccak The endpoint keccak
    /// @dev Gets the endpoint name for a specific endpoint keccak for a Trust Anchor.
    /// @return endpointName endpoint data exists, returns the endpoint name

    function getTrustAnchorEndpointNameByEndpointKeccak(address _trustAnchorAddress, bytes32 _endpointKeccak) public view returns (string memory endpointName) {
        //returns the endpoint name
        return extraData_dataRetrievalParameters[_trustAnchorAddress].keccakHash_to_dataRetrievalEndpoint[_endpointKeccak].endpointName;
    }
}

